import {makeAutoObservable} from "mobx";

export default class ProductStore {
    constructor() {
        this._genus = []
        this._products = [
            {id: 1, title: 'Какаду белохохлый', price: 60000, img: 'https://m.mirkorma.ru/upload/medialibrary/313/313b9efabeb8a8d4ed21f1a7f610c350.jpg'},
            {id: 2, title: 'Какаду чернохохлый', price: 50000, img: 'https://m.mirkorma.ru/upload/medialibrary/313/313b9efabeb8a8d4ed21f1a7f610c350.jpg'},
            {id: 3, title: 'Ара обычный xd', price: 40000},
            {id: 4, title: 'Ара обычный xd', price: 40000},
            {id: 5, title: 'Ара обычный xd', price: 40000},
            {id: 6, title: 'Ара обычный xd', price: 40000}
        ]
        this._selectedGenus = {}
        makeAutoObservable(this)
    }

    setGenus(genus) {
        this._genus = genus
    }
    setProducts(product) {
        this._products = product
    }
    setSelectedGenus(genus) {
        this._selectedGenus = genus
    }

    get genus() {
        return this._genus
    }
    get products() {
        return this._products
    }
    get selectedGenus() {
        return this._selectedGenus
    }
}
